import { Box } from "@mui/system";
import { useState } from "react";
import { useNavigate } from "react-router-dom";
import SMButton from "../config/components/button";
import SMInput from "../config/components/input";
import { logInUser } from "../config/firebase/firebasemethods";

function Login() {

  const [inpVal, setInpVal] = useState({})

  const navigate = useNavigate();
  let login = (userbj) => {
    if (!userobj.email) {
      return alert("email is required")
    }
    if (!userobj.password || userobj.password.length < 6) {
      return alert("password is required password must be atleast 6 characters")
    }
    console.log(userobj)
    logInUser(userobj).then(success => {
      console.log("user agya")

      navigate(`/${(success.user.uid)}`).then((success) => {
        console.log("hence done")
      })

    }).catch((err) => {

      console.log(err)
    })

  }

  return (
    <>
      <Box>
        <Box sx={{ padding: 1 }}>
          <SMInput onChange={(e) => { setInpVal({ ...inpVal, email: e.target.value }) }} label="Email" type="email" />
        </Box>
        <Box sx={{ padding: 1 }}>
          <SMInput onChange={(e) => { setInpVal({ ...inpVal, name: e.target.value }) }} label="Password" type="password" />
        </Box>
        <Box sx={{ padding: 1 }}>
          <SMButton onClick={login} label="Login" />
        </Box>
      </Box>
    </>
  );
}
export default Login;
